Let $T$ be a [[Definition:Topological Space|topological space]].Let $\sequence {f_t}_{t \mathop \in T}$ be a centred (i.e. mean zero) [[Definition:Gaussian Process|Gaussian process]] on $T$, such that::$
orm f_T := \sup_{t \mathop \in T} \size {f_t}$is [[Definition:Almost Surely|almost surely]] finite.Let::$\sigma_T^2 := \sup_{t \mathop \in T} \operatorname E \size {f_t}^2$Then $\map {\operatorname E} {
orm f_T}$ and $\sigma_T$ are both finite, and, for each $u > 0$::$\map {\operatorname P} {
orm f_T > \map {\operatorname E} {
orm f_T} + u} \le \map \exp {\dfrac {-u^2} {2 \sigma_T^2} }$

